import React from 'react';

const EnlistButton = ({ bot, addBotToArmy }) => {
  return (
    <div onClick={() => addBotToArmy(bot)} style={{ cursor: 'pointer', color: 'blue' }}>
      Enlist
    </div>
  );
};

export default EnlistButton;
